<script nonce="eca26e1c-4225-4744-8f97-3f21b2d9ef18">
    (function () {
        const navContainer = document.querySelector(".nav-links");
        const navLinks = navContainer.getElementsByClassName('nav-link');
        let accWidth = 0;
            
        for (let i = 0; i < navLinks.length; i++) {
            accWidth += navLinks[i].getBoundingClientRect().width;

            if (accWidth > navContainer.getBoundingClientRect().width) {
                const prevNav = navLinks[i - 1];
                const separator = prevNav.querySelector('.link-separator');
                separator.style.backgroundColor = "transparent";
                accWidth = navLinks[i].getBoundingClientRect().width;
            }
        }        
    }());
