            var LoginForm = (function(){
                var obj = {};

                obj.events = {
                    'saveUsername': {
                        'onchange': function(element){
                            document.getElementById('saveUsername').value = element.checked;
                            document.querySelector('#imgSaveUsernameCheck').style.outline = 'inherit';
                            if(element.checked == true){
                                document.querySelector('[data-id="saveUsernamePopup"]').style.display = 'block';
                                document.querySelector('#saveUsernameTitle').focus();
                                document.querySelector('#imgSaveUsernameCheck').setAttribute('src', 'data:image/png;base64,');
                                document.querySelector('#imgSaveUsernameCheck').setAttribute('checked', 'true');
                                setTimeout(function() { 
                                    document.querySelector('#saveUsernamePopup').focus(); 
                                }, 2000); 
                            } else {
                                document.querySelector('[data-id="saveUsernamePopup"]').style.display = 'none';
                                document.querySelector('#j_username').value = '';
                                document.querySelector('#imgSaveUsernameCheck').setAttribute('src', 'data:image/png;base64,');
                                document.querySelector('#imgSaveUsernameCheck').setAttribute('checked', 'false');
                            }
                        },
                        'onfocus': function(element){
                            document.querySelector('#imgSaveUsernameCheck').style.outline = 'thin solid #7DADD9';
                        },
                        'onblur': function(element){
                            document.querySelector('#imgSaveUsernameCheck').style.outline = 'inherit';
                        }
                    },
                    'saveUsernamePopup': {
                        'onclick': function(){
                            document.querySelector('[data-id="saveUsernamePopup"]').style.display = 'none';
                            document.querySelector('#saveUsernameCheckbox').focus();
                        },
                        'onKeyUp': function(event){
                            event = event || window.event;
                            if (event.keyCode === 32) {
                                obj.events.saveUsernamePopup.onclick(document.querySelector('[data-id="saveUsernameArrow"]'));
                                document.querySelector('#imgSaveUsernameCheck').style.outline = 'inherit';
                            }
                        },
                    },
                    'username': {
                        'onkeyup': function(element){
                            document.querySelector('#saveUsernameCheckbox').checked = false;
                        }
                    },
                    'destination': {
                        'onfocus': function(element){
                            document.querySelector('.custom-select').style.outline = 'thin solid #7DADD9';
                        },
                        'onblur': function(element){
                            document.querySelector('.custom-select').style.outline = 'inherit';
                        }
                    },
                    'form' : {
                    	'onsubmit' : function(evt) {
                    		evt.preventDefault();
                    		//disableSubmitsCollectUserPrefs(evt.target);
                    		evt.target.submit();
                    	}
                    }
                }
                
                if (document.querySelector("#Signon")) {
                	document.querySelector("#Signon").addEventListener('submit', obj.events.form.onsubmit);
                }

                if(document.querySelector('.alert')){
                    document.querySelector('.alert').focus();
                }

                return obj;
            })()

