       	<script nonce="eca26e1c-4225-4744-8f97-3f21b2d9ef18">
			window.onload = function(){
			    var time = 10 * 60 * 1000;
			    var flushCredsTimer;
			    var username = document.querySelector('#j_username');
			    var password = document.querySelector('#j_password');
			     
			    var startTimer = function() {
			        if (flushCredsTimer) {
			            window.clearInterval(flushCredsTimer);
			        }
			        flushCredsTimer = window.setInterval(flushCreds, time);
			    };
			
			    var clearTimer = function() {
			        if (flushCredsTimer) {
			            window.clearInterval(flushCredsTimer);
			        }
			        
			        flushCredsTimer = null;
			        startTimer();
			    };
			                 
			    var flushCreds = function() {
			        document.querySelector('#j_password').value = '';
			        
	                    document.querySelector('[data-id="saveUsernamePopup"]').style.display = 'none';
	                    document.querySelector('#j_username').value = '';
	                    document.querySelector('#imgSaveUsernameCheck').setAttribute('src', 'data:image/png;base64,');
	                    document.querySelector('#imgSaveUsernameCheck').setAttribute('checked', 'false');
	                    document.querySelector('#saveUsernameCheckbox').checked = false;
			    	
			    };
			    
			    username.addEventListener('keyup', clearTimer);
			    password.addEventListener('keyup', clearTimer);
			    startTimer();
			}
		</script>

